(let [dat {:day (range 3 29)
           :density (map #(density :full (t/date-time 2015 4 %)) (range 3 29))}] 
  (gg4clj/view
    [[:<- :d (gg4clj/data-frame dat)]
     (gg4clj/r+
       [:ggplot :d [:aes :day :density]]
       [:geom_line {:stat "identity" :color "steelblue"}]
       [:geom_point {:color "steelblue"}]
       [:xlab "Day"]
       [:ylab "Density"]
       [:ggtitle "Density Evolution"])]
    {:width 10
     :height 6}))
