(defn daily-expansion [coll]
  (let [dat {:day (range 2 30)
             :count (map
                     #(mc/count @db coll {:ts {$gt (t/plus (t/date-time 2015 4 1) (t/days %))
                                               $lt (t/plus (t/date-time 2015 4 1) (t/days (inc %)))}})
                     (range 2 30))}] 
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :day :count]]
         [:geom_line {:stat "identity" :color "steelblue"}]
         [:geom_point {:color "steelblue"}]
         [:xlab "Day"]
         [:ylab "Count"]
         [:ggtitle (str coll " daily expansion")])]
      {:width 10 :height 6})))
