(defn hourly-expansion [coll]
  (let [dat {:day (range 0 649)
             :count (map
                     #(mc/count @db coll {:ts {$gt (t/plus (t/date-time 2015 4 3) (t/hours %))
                                               $lt (t/plus (t/date-time 2015 4 3) (t/hours (inc %)))}})
                     (range 0 649))}] 
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :day :count]]
         [:geom_line {:stat "identity" :color "steelblue"}]
         [:xlab "Day"]
         [:ylab "Count"]
         [:ggtitle (str coll " hourly expansion")])]
      {:width 10 :height 6})))
